import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Box from '@material-ui/core/Box';
import Grid from '@material-ui/core/Grid';
import Container from '@material-ui/core/Container';

const useStyles = makeStyles((theme) => ({
    box: {
        padding: theme.spacing(1),
        textAlign: 'center',
        color: theme.palette.text.secondary,
        whiteSpace: 'nowrap',
        margin: theme.spacing(2),
    },
}));


export default function Detail() {
    const classes = useStyles();

    return (
        <Container>
            {/* <Grid container> */}
                <Grid item xs={12} direction="column" justify="center" alignItems="stretch" >
                    <Box bgcolor="primary.light" className={classes.box} height={50}></Box>
                </Grid>
                <Grid item xs={5} direction="column" justify="center" alignItems="stretch" >
                    <Box bgcolor="primary.light" className={classes.box} height={800}></Box>
                </Grid>
                <Grid item xs={7} direction="column" justify="center" alignItems="stretch" >
                    <Box bgcolor="primary.light" className={classes.box} height={600}></Box>
                    <Box bgcolor="primary.light" className={classes.box} height={168}></Box>
                </Grid>
            {/* </Grid> */}
        </Container>
    );
}
